import React,{useState} from 'react';
import {Link} from 'react-router-dom'; 
import Navbar from './Navbar';
import {AiOutlineArrowRight } from 'react-icons/ai';

export default function Client()
{
    const [name,setName]= useState('');
    const [channel,setChannel]= useState('');

    return(
        <div>
            <Navbar/>
            <div className='header'>
                <h1>Welcome to MedDesk</h1>
                
                <button className='header-button'> Get Started  <AiOutlineArrowRight style={{marginLeft:'10px'}} fontSize = '1.5rem'/></button>
            </div>
            <input type = "text" onChange = {(event)=>setName(event.target.value)} />
            <input type = "text" onChange = {(event)=>setChannel(event.target.value)} />
            <Link to = {`/chat?name=${name}&channel=${channel}`}>
                <button type ="submit" >Start</button>
            </Link>
            
        </div>
        
    )
}
